import React, { useEffect, useState } from 'react';
import {
  FaShieldAlt,
  FaRocket,
  FaCogs,
  FaBars,
  FaTimes,
  FaGithub,
  FaLinkedin,
} from 'react-icons/fa';

const HomePage = () => {
  const [menuOpen, setMenuOpen] = useState(false);
  const [timeLeft, setTimeLeft] = useState({
    days: 10,
    hours: 9,
    minutes: 29,
    seconds: 10,
  });

  useEffect(() => {
    const targetTime = new Date();
    targetTime.setSeconds(
      targetTime.getSeconds() +
        (timeLeft.days * 86400 +
          timeLeft.hours * 3600 +
          timeLeft.minutes * 60 +
          timeLeft.seconds)
    );

    const interval = setInterval(() => {
      const now = new Date();
      const difference = targetTime - now;

      if (difference <= 0) {
        clearInterval(interval);
        setTimeLeft({ days: 0, hours: 0, minutes: 0, seconds: 0 });
      } else {
        const days = Math.floor(difference / (1000 * 60 * 60 * 24));
        const hours = Math.floor((difference / (1000 * 60 * 60)) % 24);
        const minutes = Math.floor((difference / 1000 / 60) % 60);
        const seconds = Math.floor((difference / 1000) % 60);

        setTimeLeft({ days, hours, minutes, seconds });
      }
    }, 1000);

    return () => clearInterval(interval);
  }, []);

  return (
    <div className="font-sans text-white bg-black scroll-smooth">

      {/* Header */}
      <header className="fixed top-0 left-0 w-full z-50 bg-black bg-opacity-80 backdrop-blur-md shadow-lg">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 md:px-10 flex justify-between items-center h-16">
          <div className="text-2xl font-bold text-green-400 tracking-wide">Vortrex</div>
          <nav className="hidden md:flex space-x-4 text-white text-base">
            {['Home', 'Features', 'Presale', 'Roadmap', 'Contact'].map((item, i) => (
              <a
                key={i}
                href={`#${item.toLowerCase()}`}
                className="px-4 py-2 rounded-full bg-gray-800 hover:bg-green-500 hover:text-black transition duration-300 font-medium"
              >
                {item}
              </a>
            ))}
          </nav>
          <div className="md:hidden">
            <button
              onClick={() => setMenuOpen(!menuOpen)}
              className="text-white text-xl focus:outline-none"
            >
              {menuOpen ? <FaTimes /> : <FaBars />}
            </button>
          </div>
        </div>
        {menuOpen && (
          <div className="md:hidden bg-black px-6 py-6 space-y-4 rounded-b-xl shadow-lg border-t border-gray-700">
            {['Home', 'Features', 'Presale', 'Roadmap', 'Contact'].map((item, i) => (
              <a
                key={i}
                href={`#${item.toLowerCase()}`}
                className="block text-white px-4 py-2 rounded-lg bg-gray-800 hover:bg-green-500 hover:text-black transition duration-300"
              >
                {item}
              </a>
            ))}
          </div>
        )}
      </header>

      <div className="h-16"></div>

      {/* Hero Section with Countdown and Buttons */}
      <section
        id="hero"
        className="relative min-h-screen bg-cover bg-center flex items-center justify-center text-center px-4 sm:px-6 md:px-10"
        style={{ backgroundImage: 'url("https://images.unsplash.com/photo-1606787627690-2d5107a74138?auto=format&fit=crop&w=1080&q=80")' }}
      >
        <div className="absolute inset-0 bg-black bg-opacity-60"></div>
        <div className="relative z-10 w-full max-w-3xl mx-auto">
          <h1 className="text-4xl md:text-5xl font-bold mb-6 leading-tight animate__animated animate__fadeIn">
            Revolutionizing the Future of Crypto
          </h1>
          <p className="text-lg md:text-xl mb-6 animate__animated animate__fadeIn animate__delay-1s">
            Join the Vortrex Presale and be a part of the future today.
          </p>

          {/* CTA Buttons */}
          <div className="flex flex-wrap justify-center gap-4 mb-6">
            <button className="bg-gradient-to-r from-green-400 to-teal-500 hover:from-green-500 hover:to-teal-600 text-black font-bold px-6 py-3 rounded-full shadow-lg transform hover:scale-105 transition duration-300">
              Buy Tokens Now
            </button>
            <button className="bg-gradient-to-r from-purple-500 to-pink-500 px-6 py-3 text-white rounded-full font-semibold hover:scale-105 transition">
              Read Documents
            </button>
          </div>

          {/* Countdown Timer */}
          <div className="bg-gray-900 bg-opacity-60 backdrop-blur-md p-6 rounded-xl shadow-inner grid grid-cols-2 sm:grid-cols-4 gap-6 mt-6">
            {[
              { label: 'Days', value: timeLeft.days },
              { label: 'Hours', value: timeLeft.hours },
              { label: 'Minutes', value: timeLeft.minutes },
              { label: 'Seconds', value: timeLeft.seconds }
            ].map((item, idx) => (
              <div key={idx} className="text-center">
                <div className="text-4xl font-bold text-white">
                  {String(item.value).padStart(2, '0')}
                </div>
                <div className="text-sm text-gray-300">{item.label}</div>
              </div>
            ))}
          </div>
        </div>
      </section>

      {/* The rest of your original sections (Features, Presale, Roadmap, Contact) remain unchanged... */}
      {/* ... */}
    </div>
  );
};

export default HomePage;
